/* 左边 */
// 柱状图
(function() {
    // 初始化echarts实列对象
    var myChart = echarts.init(document.querySelector(".bar .chart"));
    // 指定配置项和数据(option)

    //诗词信息汇总
    $.ajax({
            url: "/desty_sum",
            type: "POST",
            dataType: "json",
            async: true,
            success: function (res) {
                // alert(res['宋代']);
                var i=0;
                sname=[];value=[];
                for(var key in res)
                {
                    sname.push(key);
                    value.push(res[key]);
                }
                var option = {
                    color: ["#2f89cf"],
                    tooltip: {
                        trigger: "axis",
                        axisPointer: {
                            // 坐标轴指示器，坐标轴触发有效
                            type: "shadow", // 默认为直线，可选为：'line' | 'shadow'
                        },
                    },
                    // 修改图标的大小
                    grid: {
                        left: "0%",
                        top: "10px",
                        right: "0%",
                        bottom: "4%",
                        containLabel: true,
                    },
                    xAxis: [{
                        type: "category",
                        data: sname,
                        axisTick: {
                            alignWithLabel: true,
                        },
                        // 修改刻度标签相关样式
                        axisLabel: {
                            color: "rgba(255, 255, 255, .6)",
                            fontSize: "12",
                            interval: 0, //控制是否全部显示
                        },
                        // 不显示x轴的样式
                        axisLine: {
                            show: false,
                        },
                    }, ],
                    yAxis: [{
                        type: "value",
                        // 修改刻度标签相关样式
                        axisLabel: {
                            color: "rgba(255, 255, 255, .6)",
                            fontSize: "12",
                        },
                        // y轴坐标系
                        axisLine: {
                            lineStyle: {
                                color: "rgba(255, 255, 255, .1)",
                                width: 2,
                            },
                        },
                        // y轴分割线的颜色
                        splitLine: {
                            lineStyle: {
                                color: "rgba(255, 255, 255, .1)",
                            },
                        },
                    }, ],
                    series: [{
                        name: "诗词总数",
                        type: "bar",
                        // 修改柱子的宽度
                        barWidth: "35%",
                        data: value,
                        itemStyle: {
                            // 修改柱子的圆角
                            barBorderRadius: 5,
                        },
                    }, ],
                };
                // 把配置项给实列对象
                myChart.setOption(option);
            },
            error: function (e) {
                alert("出现错误！！");
            }
        });

    // 让图表跟随屏幕自动的去适应
    window.addEventListener("resize", function() {
        myChart.resize();
    });
})();

